import './ImageList.css';
import React from "react";
import ImageCard from './ImageCard';

const List = props => {
    const images = props.images.map(({ description, id, urls }) => {
        return <ImageCard key={id}/>;
    });

    return <div className="image-list">{images}</div>;
};

export default List;
